import React from "react";
import Image from "./TestImage.js";
import { Canvas } from 'react-three-fiber'
// wraps the image into a Canvas
function TestImageWrapper() {
  return (

    <Canvas >
	    <mesh>

	      <Image
	      	attach="geometry"
	      	arcs={[1,1,1]}
	       />

	    </mesh>

    </Canvas>
  )
}
export default TestImageWrapper;
